    <div className="App d-flex flex-column">
      <BrowserRouter>
        <Header
          nupirkta={nupirkta}
          logedUser={logedUser}
          setLogedUser={setLogedUser}
        />

        <Routes>
          <Route
            path="/"
            element={
              <LoginPage setLogedUser={setLogedUser} setWord={setWord} />
            }
          />
          <Route path="/register" element={<RegisterPage />} />
          <Route
            path="/profile"
            element={
              <ProfilePage
                logedUser={logedUser}
                setLogedUser={setLogedUser}
                setNupirkta={setNupirkta}
              />
            }
          />
          <Route
            path="/uploadProduct"
            element={<UploadProductPage logedUser={logedUser} />}
          />
          <Route
            path="/allProducts"
            element={
              <AllProdPage products={products} setProducts={setProducts} />
            }
          />
          <Route
            path="/myProducts"
            element={<MyProductPage nupirkta={nupirkta} />}
          />
          <Route
            path="/game"
            element={<GamePage word={word} setWord={setWord} />}
          />
          <Route
            path="/singleProduct/:id"
            element={
              <SingleProduct
                products={products}
                logedUser={logedUser}
                setNupirkta={setNupirkta}
                setLogedUser={setLogedUser}
              />
            }
          />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
